import loadingScreen from "./loadingScreen.js";
import { openNav, closeNav } from "./nav.js";



class Activity {
	constructor(name, media, link, chillLevel, categories, font) {
		this.name = name;
		this.media = media;
		this.link = link;
		this.chillLevel = chillLevel;
		this.categories = categories;
		this.font = font;
	}
}
// Level 1
